Here is a basic smart contract that can handle recurrent payments:

```solidity
pragma solidity ^0.4.25;

contract RecurrentPayment {
    address public sender;      // Address of the sender
    address public recipient;   // Address of the recipient
    uint public amount;        // Amount to be paid each time
    uint public interval;      // Interval between payments (in seconds)
    uint public lastPayment;   // Timestamp of the last payment

    constructor(address _recipient, uint _amount, uint _interval) public {
        sender = msg.sender;
        recipient = _recipient;
        amount = _amount;
        interval = _interval;
        lastPayment = now;
    }

    function makePayment() public {
        require(msg.sender == sender);
        require(now - lastPayment >= interval);

        recipient.transfer(amount);
        lastPayment = now;
    }
}
```

This contract defines:

- The sender (person funding the payments) 
- The recipient (person receiving the payments)
- The payment amount
- The interval between payments
- The timestamp of the last payment

The `makePayment()` function can be called to make a payment. It ensures:

- Only the sender can call it
- Enough time has elapsed since the last payment
- It then transfers the funds and updates the last payment timestamp

So this contract can be deployed by the sender, who then calls `makePayment()` at the specified interval to make recurrent payments to the recipient.

