Here is the RummyGame class that extends the BasicGame class and plays the game Gin-Rummy:

```
class RummyGame extends BasicGame {
    constructor (roomId,io) {
        super(roomId,io);
        this.deck = [];
        this.discardedCards = [];
        this.currentPlayerIndex = 0;
        this.playersDrawnCard = false;
        this.maxPlayers = 2;
        this.currentPlayer = null;
        this.finishedPlayers = [];
        this.buildDeck();
        this.dealCards();
    }

    buildDeck() {
        const suits = ['Spades', 'Hearts', 'Diamonds', 'Clubs'];
        const ranks = ['Ace','2','3','4','5','6','7','8','9','10','Jack','Queen','King'];
        for (let suit of suits) {
            for (let rank of ranks) {
                this.deck.push(`${rank} of ${suit}`);
            }
        }
    }

    shuffleDeck() {
        let currentIndex = this.deck.length;
        let temporaryValue, randomIndex;

        while (0 !== currentIndex) {
            randomIndex = Math.floor(Math.random() * currentIndex);
            currentIndex -= 1;
            temporaryValue = this.deck[currentIndex];
            this.deck[currentIndex] = this.deck[randomIndex];
            this.deck[randomIndex] = temporaryValue;
        }
    }

    dealCards() {
        this.shuffleDeck();
        for (let i = 0; i < this.maxPlayers; i++) {
            let playerCards = [];
            for (let j = 0; j < 10; j++) {
                playerCards.push(this.deck.pop());
            }
            this.players[Object.keys(this.players)[i]].cards = playerCards;
        }
        this.discardedCards.push(this.deck.pop());
    }

    Start (data = null) {
        super.Start();
        // Set the current player
        this.currentPlayer = this.players[Object.keys(this.players)[this.currentPlayerIndex]];
        // Emit game start event
        this.io.to(this.roomId).emit('gameStart', {players: this.players, currentPlayer: this.currentPlayer});
    }

    PlayMove(data = null) {
        if (this.currentPlayer.id !== data.playerId) return false;

        if (data.type === 'drawCard') {
            if (this.playersDrawnCard) return false;

            const drawnCard = this.deck.pop();
            this.currentPlayer.cards.push(drawnCard);
            this.playersDrawnCard = true;

            // Emit draw card event
            this.io.to(this.roomId).emit('drawCard', {playerId: this.currentPlayer.id, drawnCard: drawnCard});

            // Check if the player has won
            if (this.checkWin(this.currentPlayer.cards)) {
                this.finishPlayer(this.currentPlayer);
            }
        } else if (data.type === 'discardCard') {
            const discardedCardIndex = this.currentPlayer.cards.indexOf(data.card);
            if (discardedCardIndex === -1) return false;

            this.discardedCards.push(this.currentPlayer.cards.splice(discardedCardIndex, 1)[0]);
            this.playersDrawnCard = false;

            // Emit discard card event
            this.io.to(this.roomId).emit('discardCard', {playerId: this.currentPlayer.id, discardedCard: data.card});

            // Check if the player has won
            if (this.checkWin(this.currentPlayer.cards)) {
                this.finishPlayer(this.currentPlayer);
            }

            // Move to the next player
            this.moveToNextPlayer();
        }
    }

    moveToNextPlayer() {
        this.currentPlayerIndex++;
        if (this.currentPlayerIndex >= this.maxPlayers) this.currentPlayerIndex = 0;
        this.currentPlayer = this.players[Object.keys(this.players)[this.currentPlayerIndex]];
        this.playersDrawnCard = false;

        // Emit next player event
        this.io.to(this.roomId).emit('nextPlayer', {currentPlayer: this.currentPlayer});
    }

    checkWin(cards) {
        // TODO: Implement Gin-Rummy win check
        return false;
    }

    finishPlayer(player) {
        // Remove the player from the players object
        delete this.players[player.id];
        // Add the player to the finished players array
        this.finishedPlayers.push(player);
        // Emit player finish event
        this.io.to(this.roomId).emit('playerFinish', {player: player});
        // Check if the game is over
        if (Object.keys(this.players).length === 1) {
            this.Finish();
        } else {
            // Move to the next player
            this.moveToNextPlayer();
        }
    }
