Here's an example of a simple GStreamer plugin in C language that adds a constant value to the audio samples:

```c
#include <gst/gst.h>

#define GST_TYPE_CONST_AUDIO_SRC \
  (gst_const_audio_src_get_type())
#define GST_CONST_AUDIO_SRC(obj) \
  (G_TYPE_CHECK_INSTANCE_CAST((obj),GST_TYPE_CONST_AUDIO_SRC,GstConstAudioSrc))
#define GST_CONST_AUDIO_SRC_CLASS(klass) \
  (G_TYPE_CHECK_CLASS_CAST((klass),GST_TYPE_CONST_AUDIO_SRC,GstConstAudioSrcClass))
#define GST_IS_CONST_AUDIO_SRC(obj) \
  (G_TYPE_CHECK_INSTANCE_TYPE((obj),GST_TYPE_CONST_AUDIO_SRC))
#define GST_IS_CONST_AUDIO_SRC_CLASS(klass) \
  (G_TYPE_CHECK_CLASS_TYPE((klass),GST_TYPE_CONST_AUDIO_SRC))
#define GST_CONST_AUDIO_SRC_GET_CLASS(obj) \
  (G_TYPE_INSTANCE_GET_CLASS((obj),GST_TYPE_CONST_AUDIO_SRC,GstConstAudioSrcClass))

typedef struct _GstConstAudioSrc GstConstAudioSrc;
typedef struct _GstConstAudioSrcClass GstConstAudioSrcClass;

struct _GstConstAudioSrc {
  GstElement element;
  GstPad *srcpad;
  GstBuffer *buf;
  guint samples;
  guint rate;
};

struct _GstConstAudioSrcClass {
  GstElementClass parent_class;
};

GType gst_const_audio_src_get_type (void);

static void gst_const_audio_src_class_init (GstConstAudioSrcClass *klass);
static void gst_const_audio_src_init (GstConstAudioSrc *src);
static gboolean gst_const_audio_src_start (GstBaseSrc *basesrc);
static gboolean gst_const_audio_src_stop (GstBaseSrc *basesrc);
static GstFlowReturn gst_const_audio_src_create (GstPushSrc *src, GstBuffer **buf);

#define GST_CONST_AUDIO_SRC_CAPS \
  "audio/x-raw,format=S16LE,channels=1,rate=[1,MAX]"

G_DEFINE_TYPE (GstConstAudioSrc, gst_const_audio_src, GST_TYPE_BASE_SRC);

static void
gst_const_audio_src_class_init (GstConstAudioSrcClass *klass)
{
  GstElementClass *element_class = GST_ELEMENT_CLASS (klass);
  GstBaseSrcClass *basesrc_class = GST_BASE_SRC_CLASS (klass);
  GstPushSrcClass *pushsrc_class = GST_PUSH_SRC_CLASS (klass);

  gst_element_class_add_pad_template (element_class,
      gst_pad_template_new ("src", GST_PAD_SRC, GST_PAD_ALWAYS,
          gst_caps_from_string (GST_CONST_AUDIO_SRC_CAPS)));

  basesrc_class->start = GST_DEBUG_FUNCPTR (gst_const_audio_src_start);
  basesrc_class->stop = GST_DEBUG_FUNCPTR (gst_const_audio_src_stop);

  pushsrc_class->create = GST_DEBUG_FUNCPTR (gst_const_audio_src_create);
}

static void
gst_const_audio_src_init (GstConstAudioSrc *src)
{
  src->srcpad = gst_pad_new_from_static_template (
      gst_element_class_get_pad_template (GST_ELEMENT_CLASS (src),
          "src"));
  gst_pad_set_element_private (src->srcpad, src);
  gst_element_add_pad (GST_ELEMENT (src), src->srcpad);
}

static gboolean
gst_const_audio_src_start (GstBaseSrc *basesrc)
{
  GstConstAudioSrc *src = GST_CONST_AUDIO_SRC (basesrc);
  GstCaps *caps;
  guint rate;

  caps = gst_pad_get_current_caps (GST_PAD (src->srcpad));
  gst_structure_get_int (gst_caps_get_structure (caps, 0), "rate", &rate);
  gst_caps_unref (caps);

  src->rate = rate;
  src->samples = 0;

  return TRUE;
}

static gboolean
gst_const_audio_src_stop (GstBaseSrc *basesrc)
{
  GstConstAudioSrc *src = GST_CONST_AUDIO_SRC (basesrc);

  if (src->buf) {
    gst_buffer_unref (src->buf);
    src->buf = NULL;
  }

  return TRUE;
}

static GstFlowReturn
gst_const_audio_src_create (GstPushSrc *src, GstBuffer **buf)
{
  GstConstAudioSrc *constsrc = GST_CONST_AUDIO_SRC (src);
  gint16 *samples;
  guint i;

  constsrc->buf = gst_buffer_new_and_alloc (constsrc->rate / 10);
  gst_buffer_map (constsrc->buf, (GstMapFlags) GST_MAP_WRITE, NULL, NULL,
      &samples);

  for (i = 0; i < constsrc->rate / 10; i++)
    samples[i] = 10000;  // add a constant value to the audio samples

  gst_buffer_unmap (constsrc->buf, samples);

  *buf = constsrc->buf;

  return GST_FLOW_OK;
}

static void
gst_const_audio_src_init (GstConstAudioSrc *src)
{
  src->srcpad = gst_pad_new_from_static_template (
      gst_element_class_get_pad_template (GST_ELEMENT_CLASS (src),
          "src"));
  gst_pad_set_element_private (src->srcpad, src);
  gst_element_add_pad (GST_ELEMENT (src), src->srcpad);
}
```

This plugin creates a new element called "constaudiosrc" that generates a constant audio signal with a value of 10000. To compile and install this plugin, follow these steps:

1. Save the plugin code to a file named constaudiosrc.c.

2. Create a new directory named constaudiosrc in the plugins directory of the GStreamer source tree.

3. Create a new file named Makefile.am in the constaudiosrc directory, and add the following lines:

