Here's a Java method that can be used to separate a string into an array based on carriage returns:

```
public static String[] separateCarriageReturns(String inputString) {
    String[] result = new String[inputString.length()];
    int index = 0;
    for (int i = 0; i < inputString.length(); i++) {
        if (inputString.charAt(i) == '\r') {
            result[index] = inputString.substring(0, i);
            index++;
            continue;
        }
        result[index] = inputString.charAt(i);
        index++;
    }
    return result;
}
```

This method loops through the input string character by character, checking if the character is a carriage return. If it is, the substring from the previous index to the current index is stored in the result array. The index of the substring is then incremented, and the loop continues until all characters have been processed.

The result array is then returned.

