```

3. Create a `src/backend.rs` file with the following content:

```rust
use serde::{Deserialize, Serialize};
use std::collections::HashMap;

pub trait Backend {
    fn get(&self, key: &str) -> Result<Option<String>, Box<dyn std::error::Error>>;
    fn set(&self, key: &str, value: &str) -> Result<(), Box<dyn std::error::Error>>;
}

#[derive(Serialize, Deserialize, Debug, PartialEq)]
pub struct InMemoryBackend {
    data: HashMap<String, String>,
}

impl InMemoryBackend {
    pub fn new() -> Self {
        Self {
            data: HashMap::new(),
        }
    }
}

impl Backend for InMemoryBackend {
    fn get(&self, key: &str) -> Result<Option<String>, Box<dyn std::error::Error>> {
        Ok(self.data.get(key).cloned())
    }

    fn set(&self, key: &str, value: &str) -> Result<(), Box<dyn std::error::Error>> {
        self.data.insert(key.to_owned(), value.to_owned());
        Ok(())
    }
}
```

4. Create a `src/sled_backend.rs` file with the following content:

```rust
use crate::backend::Backend;
use sled::{Db, IVec};
use std::str::from_utf8;

pub struct SledBackend {
    db: Db,
}

impl SledBackend {
    pub fn new(path: &str) -> Result<Self, Box<dyn std::error::Error>> {
        let db = sled::open(path)?;
        Ok(Self { db })
    }
}

impl Backend for SledBackend {
    fn get(&self, key: &str) -> Result<Option<String>, Box<dyn std::error::Error>> {
        let iv = self.db.get(key)?;
        match iv {
            Some(value) => Ok(Some(from_utf8(&value)?.to_owned())),
            None => Ok(None),
        }
    }

    fn set(&self, key: &str, value: &str) -> Result<(), Box<dyn std::error::Error>> {
        self.db.insert(key, value.as_bytes())?;
        self.db.flush()?;
        Ok(())
    }
}
```

5. Modify the `src/lib.rs` file with the following content:

```rust
mod backend;
mod sled_backend;

pub use backend::{Backend, InMemoryBackend};
pub use sled_backend::SledBackend;

use log::{error, info};

pub struct ConfigService<T: Backend> {
    backend: T,
}

impl<T: Backend> ConfigService<T> {
    pub fn new(backend: T) -> Self {
        Self { backend }
    }

    pub fn get(&self, key: &str) -> Option<String> {
        match self.backend.get(key) {
            Ok(value) => value,
            Err(e) => {
                error!("Failed to get value for key '{}': {}", key, e);
                None
            }
        }
    }

    pub fn set(&self, key: &str, value: &str) {
        match self.backend.set(key, value) {
            Ok(_) => info!("Set value for key '{}'", key),
            Err(e) => error!("Failed to set value for key '{}': {}", key, e),
        }
    }
}
```

