Creating a complete script for exporting 2D animations from Blender3D to Flutter is quite an extensive task. However, I can provide you with an outline and some starting points to help you create your own script.

1. Export Blender3D animations as individual images (keyframes)

In Blender, you can export your 2D animations as a sequence of images. Set up your 2D animation in Blender using Grease Pencil or any other preferred method. To export the animation as an image sequence, follow these steps:

a. Set the output format to PNG or any other image format.
b. Set the output path where you want to save the image sequence.
c. Render the animation (Ctrl + F12).

2. Convert the image sequence to a format usable in Flutter

After exporting the animation as an image sequence, you can use the 'image_sequence_animation' package in Flutter to play the animation. First, add this package to your `pubspec.yaml`:

```yaml
dependencies:
  image_sequence_animator: ^1.1.0
```

3. Load the image sequence in your Flutter project

Put the image sequence files in your Flutter project's assets folder and declare them in `pubspec.yaml`:

```yaml
flutter:
  assets:
    - assets/images/animation/frame_0001.png
    - assets/images/animation/frame_0002.png
    - assets/images/animation/frame_0003.png
```

4. Play the animation in your Flutter app

Now you can use the `ImageSequenceAnimator` widget to play the animation in your Flutter app:

```dart
import 'package:flutter/material.dart';
import 'package:image_sequence_animator/image_sequence_animator.dart';

void main() {
  runApp(MyApp());
}

class MyApp extends StatelessWidget {
  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      home: Scaffold(
        appBar: AppBar(title: Text('Blender Animation')),
        body: Center(
          child: ImageSequenceAnimator(
            "assets/images/animation/frame_", // Prefix of the image sequence
            1, // Start index of the sequence
            3, // End index of the sequence
            "png", // File format
            60, // Frame rate (FPS)
            isLooping: true, // Set to true for looping animation
          ),
        ),
      ),
    );
  }
}
```

This is just a starting point for your project. You'll need to adjust the script and the Flutter code according to your specific needs and animation.

