Just Intonation is a tuning system that uses simple whole-number frequency ratios for creating musical intervals. In this example, I'll show you how to create a simple JavaScript program that plays a major scale using Just Intonation ratios.

First, let's prepare the HTML file that includes an audio context and buttons to play the notes.

```html
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Just Intonation Major Scale</title>
</head>
<body>
    <button onclick="playFrequency(1)">C</button>
    <button onclick="playFrequency(9/8)">D</button>
    <button onclick="playFrequency(5/4)">E</button>
    <button onclick="playFrequency(4/3)">F</button>
    <button onclick="playFrequency(3/2)">G</button>
    <button onclick="playFrequency(5/3)">A</button>
    <button onclick="playFrequency(15/8)">B</button>
    <button onclick="playFrequency(2)">C</button>

    <script src="just-intonation.js"></script>
</body>
</html>
```

Now, let's create the JavaScript file "just-intonation.js" that contains the code to play the notes using Just Intonation tuning.

```javascript
const audioContext = new (window.AudioContext || window.webkitAudioContext)();

function playFrequency(ratio) {
    const baseFrequency = 261.63; // C4 (middle C) in Hz
    const frequency = baseFrequency * ratio;

    const oscillator = audioContext.createOscillator();
    const gainNode = audioContext.createGain();

    oscillator.connect(gainNode);
    gainNode.connect(audioContext.destination);

    oscillator.frequency.value = frequency;
    oscillator.type = 'sine';

    gainNode.gain.setValueAtTime(0.5, audioContext.currentTime);
    gainNode.gain.exponentialRampToValueAtTime(0.001, audioContext.currentTime + 2);

    oscillator.start();
    oscillator.stop(audioContext.currentTime + 2);
}
```

Save both files in the same folder and open the HTML file in a web browser. You will see buttons representing the notes of a major scale. When you click on a button, it will play the corresponding note using Just Intonation ratios.

