public long getSumOfPrimes(int amountOfPrimes) {
    long sum = 0;
    for (int i = 2; i <= amountOfPrimes; i++) {
        boolean isPrime = true;
        for (int j = 2; j < i; j++) {
            if (i % j == 0) {
