To find the shortest path in a graph, we can use Dijkstra's algorithm. Here's a simple Java program that demonstrates Dijkstra's algorithm to find the shortest path between two nodes in a weighted graph:

```java
import java.util.*;

class Edge {
    int from, to, weight;

    public Edge(int from, int to, int weight) {
        this.from = from;
        this.to = to;
        this.weight = weight;
    }
}

public class ShortestPath {

    public static void main(String[] args) {
        int n = 6;
        List<Edge> edges = new ArrayList<>(Arrays.asList(
                new Edge(0, 1, 5),
                new Edge(0, 2, 1),
                new Edge(1, 3, 3),
                new Edge(2, 3, 6),
                new Edge(2, 4, 6),
                new Edge(3, 5, 1),
                new Edge(4, 5, 2)
        ));

        int startNode = 0;
        int endNode = 5;

        int[] shortestPath = dijkstra(n, edges, startNode);
        System.out.println("Shortest path from node " + startNode + " to node " + endNode + " is: " + shortestPath[endNode]);
    }

    static int[] dijkstra(int n, List<Edge> edges, int startNode) {
        Map<Integer, List<Edge>> graph = new HashMap<>();
        for (Edge edge : edges) {
            if (!graph.containsKey(edge.from)) {
                graph.put(edge.from, new ArrayList<>());
            }
            graph.get(edge.from).add(edge);
        }

        PriorityQueue<int[]> pq = new PriorityQueue<>(Comparator.comparingInt(a -> a[1]));
        pq.offer(new int[]{startNode, 0});

        int[] distances = new int[n];
        Arrays.fill(distances, Integer.MAX_VALUE);
        distances[startNode] = 0;

        Set<Integer> visited = new HashSet<>();

        while (!pq.isEmpty()) {
            int[] curr = pq.poll();
            int node = curr[0];
            int distance = curr[1];

            if (visited.contains(node)) continue;
            visited.add(node);

            if (graph.containsKey(node)) {
                for (Edge edge : graph.get(node)) {
                    int newDistance = distance + edge.weight;
                    if (newDistance < distances[edge.to]) {
                        distances[edge.to] = newDistance;
                        pq.offer(new int[]{edge.to, newDistance});
                    }
                }
            }
        }

        return distances;
    }
}
```

This program defines a simple Edge class to represent the graph's edges and uses Dijkstra's algorithm to find the shortest path between two nodes. The example graph contains 6 nodes, and the program calculates the shortest path from node 0 to node 5. The output will display the shortest path distance.

You can modify the graph edges and nodes, as well as the start and end nodes, to test different scenarios.

