Here's an example of an event listener in JavaScript that filters a table tbody rows in the first column based on the text in an input field:

```html
<!DOCTYPE html>
<html>
<head>
<style>
  .hidden {
    display: none;
  }
</style>
</head>
<body>

<input type="text" id="searchInput" placeholder="Search..">

<table id="myTable">
  <thead>
    <tr>
      <th>Column 1</th>
      <th>Column 2</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <td>Apple</td>
      <td>Green</td>
    </tr>
    <tr>
      <td>Banana</td>
      <td>Yellow</td>
    </tr>
    <tr>
      <td>Cherry</td>
      <td>Red</td>
    </tr>
  </tbody>
</table>

<script>
document.getElementById("searchInput").addEventListener("input", function() {
  const inputValue = this.value.toLowerCase();
  const table = document.getElementById("myTable");
  const rows = table.getElementsByTagName("tr");

  for (let i = 1; i < rows.length; i++) {
    const firstColumn = rows[i].getElementsByTagName("td")[0];
    const textValue = firstColumn.textContent || firstColumn.innerText;

    if (textValue.toLowerCase().indexOf(inputValue) > -1) {
      rows[i].classList.remove("hidden");
    } else {
      rows[i].classList.add("hidden");
    }
  }
});
</script>

</body>
</html>
```

This code creates an input field and a table with some sample data. It then adds an event listener to the input field that listens for any changes in its value. When the input value changes, it filters the table rows based on the text in the first column.

