To write CRUD operations for a REST API in Spring with Kotlin, you will need to follow these steps:

1. Define your database objects, including their structure and relationships.
2. Set up a Spring Boot project with Kotlin and configure your project to use a database, such as MySQL or PostgreSQL.
3. Create a REST controller class and annotate it with `@RestController`.
4. Create a repository interface that extends `JpaRepository` or `CrudRepository` and define the methods for each CRUD operation. For example, `findAll`, `findById`, `save`, `delete`, and `update`.
5. In the controller class, annotate the methods that handle each CRUD operation with `@GetMapping`, `@PostMapping`, `@PutMapping`, and `@DeleteMapping` annotations, respectively.
6. Use the repository methods in the controller methods to perform the database operations.

Here is an example of a REST controller class for a `User` entity:
```
@RestController
class UserController(private val userRepository: UserRepository) {

    @GetMapping("/users")
    fun findAll(): List<User> {
        return userRepository.findAll()
    }

    @GetMapping("/users/{id}")
    fun findById(@PathVariable Long id: Long): User {
        return userRepository.findById(id)
    }

    @PostMapping("/users")
    fun save(@RequestBody User user: User): User {
        return userRepository.save(user)
    }

    @PutMapping("/users/{id}")
    fun update(@PathVariable Long id: Long, @RequestBody User user: User): User {
        return userRepository.update(id, user)
    }

    @DeleteMapping("/users/{id}")
    fun delete(@PathVariable Long id: Long) {
        userRepository.deleteById(id)
    }
}
```
Note that this is just a basic example and you may need to modify the code to fit your specific requirements.

