```cpp
#include <iostream>
using namespace std;

int ringReduce(int n, int m) {
    int remainder = n % m;
    if (remainder < 0) 
        remainder += m;
    return remainder;  
}

int main() {
    int n, m;

    cout << "Enter number: ";
    cin >> n;
    cout << "Enter modulus: ";    
    cin >> m;

    int result = ringReduce(n, m);

    cout << "Result: " << result;

    return 0;
}
```

This program does the following:

1. It takes input for the number n and modulus m.
2. It calls the ringReduce() function which performs the ring reduction operation. 
3. The ringReduce() function finds the remainder of n when divided by m. 
4. If the remainder is negative, it adds m to make it positive. 
5. It returns the positive remainder which is the result of the ring reduction.
6. The result is printed.

The ringReduce() function performs modular arithmetic, ensuring that the result is always between 0 and m-1 inclusive.

