```
def binary_search(arr, target):
    left = 0
    right = len(arr) - 1

    while left < right:
        mid = left + (right - left) // 2
        if arr[mid] == target:
            return mid
        elif arr[mid] < target:
            left = mid + 1
        else:
            right = mid

    return -1

```

This implementation uses a simple binary search algorithm to search for an element in an array. The algorithm works by repeatedly dividing the search space in half and comparing the element to the middle of the search space. If the element is found, that middle index is returned. If not, the search space is further divided until the element is found or the entire search space has been searched. If the element is not found, the search space is the entire search space, and -1 is returned to indicate that the element is not found in the array.

