#include <sfml/sfml.h>
#include <sfml/Image.h>
#include <sfml/ImageIndex.h>
#include <sfml/ImageLoader.h>
#include <sfml/Spritesheet.h>

using namespace std;

// Spritesheet class
class Spritesheet {
public:
    Spritesheet(const string& name, const string& file_path)
        : m_name(name), m_file_path(file_path) {}

    void load() {
        Image* image = ImageLoader::load(m_file_path);
        if (image != NULL) {
            ImageIndex index;
            index.loadImage(image);
            m_sprites.push_back(Spritesheet(m_name, index.image_path));
        }
    }

    void unload() {
        Image* image = ImageLoader::load(m_file_path);
        if (image != NULL) {
            for (auto& Sprite : m_sprites) {
                Sprite.load();
            }
            ImageLoader::load(m_file_path, image);
        }
    }

private:
    string m_name;
    string m_file_path;
    vector<SpriteSheet> m_sprites;
};

int main() {
    sfml::Application app;
    Spritesheetsheet ss(m_name, "Spritesheet.stf");
    app.load(&ss);
    app.run();
    app.quit();
    return 0;
}
```

