class SpriteSheet
{
public:
    SpriteSheet(const std::string& filePath, int spriteWidth, int spriteHeight)
    {
        if (!m_texture.loadFromFile(filePath))
        {
            // Handle error
        }

        m_spriteSize = sf::Vector2i(spriteWidth, spriteHeight);

        int rows = m_texture.getSize().y / spriteHeight;
        int columns = m_texture.getSize().x / spriteWidth;

        for (int y = 0; y < rows; ++y)
        {
            for (int x = 0; x < columns; ++x)
            {
                sf::IntRect rect(x * spriteWidth, y * spriteHeight, spriteWidth, spriteHeight);
                m_sprites.push_back(sf::Sprite(m_texture, rect));
            }
        }
    }

    sf::Sprite& getSprite(int index)
    {
        if (index >= 0 && index < static_cast<int>(m_sprites.size()))
        {
            return m_sprites[index];
        }
        else
        {
            // Handle error
        }
    }

private:
    sf::Texture m_texture;
    sf::Vector2i m_spriteSize;
    std::vector<sf::Sprite> m_sprites;
};
```

