Yes, I can write a smart contract to facilitate recurring payments. Here's an example:

```
pragma solidity ^0.8.0;

contract RecurringPayment {
    address payable public recipient;
    uint public paymentAmount;
    uint public paymentInterval;
    uint public lastPaymentTimestamp;

    constructor(address payable _recipient, uint _paymentAmount, uint _paymentInterval) {
        recipient = _recipient;
        paymentAmount = _paymentAmount;
        paymentInterval = _paymentInterval;
        lastPaymentTimestamp = block.timestamp;
    }

    function makePayment() public payable {
        require(msg.sender == recipient, "Only the recipient can trigger payments");
        require(block.timestamp >= lastPaymentTimestamp + paymentInterval, "Payment interval not yet reached");

        uint numPayments = (block.timestamp - lastPaymentTimestamp) / paymentInterval;
        uint totalPayment = numPayments * paymentAmount;

        require(address(this).balance >= totalPayment, "Insufficient contract balance to make payments");

        recipient.transfer(totalPayment);
        lastPaymentTimestamp += numPayments * paymentInterval;
    }

    function updatePaymentAmount(uint _paymentAmount) public {
        require(msg.sender == recipient, "Only the recipient can update the payment amount");
        paymentAmount = _paymentAmount;
    }

    function updatePaymentInterval(uint _paymentInterval) public {
        require(msg.sender == recipient, "Only the recipient can update the payment interval");
        paymentInterval = _paymentInterval;
    }

    function withdraw() public {
        require(msg.sender == recipient, "Only the recipient can withdraw funds");
        recipient.transfer(address(this).balance);
    }
}
```

This contract allows the recipient to set a payment amount and interval, and then trigger payments at regular intervals. The recipient can also update the payment amount and interval as needed, and withdraw any accumulated funds. It's important to note that the recipient is responsible for triggering payments - the contract does not automatically make payments on its own.

