def quicksort(arr):
    n = len(arr)
    if n <= 1:
        return arr
    pivot = arr[0]
    for i in range(1, n):
        for j in range(i, n):
            if arr[j] < arr[j-1]:
                arr[j], arr[j-1] = arr[j-1], arr[j]

    arr[0], arr[1] = arr[1], arr[0]
    for i in range(1, n-1):
        for j in range(i, n-1):
            if arr[j] < arr[j-1]:
                arr[j], arr[j-1] = arr[j-1], arr[j]

    return arr

arr = [90, 78, 108, 0]
