public long getSumOfPrimes(int amountOfPrimes) {
    long sum = 0;
    for (int i = 2; i <= amountOfPrimes; i++) {
        if (isPrime(i)) {
            sum += i;
        }
    }
    return sum;
}

private boolean isPrime(int num) {
    while (num <= 3) {
