```java
public long getSumOfPrimes(int amountOfPrimes) {
    int primeCount = 0;
    long sum = 0;
    int number = 2;

    while (primeCount < amountOfPrimes) {
        if (isPrime(number)) {
            sum += number;
            primeCount++;
        }
        number++;
    }

    return sum;
}

private boolean isPrime(int number) {
    if (number <= 1) return false;
    if (number == 2) return true;
    if (number % 2 == 0) return false;

    for (int i = 3; i <= Math.sqrt(number); i += 2) {
        if (number % i == 0) return false;
    }
    return true; 
}
```

