Here's an example of how you can write CRUD operations REST API around database objects in Spring using Kotlin:

1. Create a new Spring Boot project in Kotlin.

2. Add the necessary dependencies to your build.gradle file:

```
dependencies {
    implementation("org.springframework.boot:spring-boot-starter-web")
    implementation("org.springframework.boot:spring-boot-starter-data-jpa")
    runtimeOnly("com.h2database:h2")
}
```

3. Create a database entity class:

```kotlin
@Entity
data class Book(
    @Id
    @GeneratedValue(strategy = GenerationType.IDENTITY)
    val id: Long?,
    val title: String,
    val author: String,
    val year: Int
)
```

4. Create a repository interface:

```kotlin
@Repository
interface BookRepository : JpaRepository<Book, Long>
```

5. Create a controller class:

```kotlin
@RestController
@RequestMapping("/api/books")
class BookController(
    private val bookRepository: BookRepository
) {
    @GetMapping
    fun findAll(): List<Book> = bookRepository.findAll()

    @PostMapping
    fun create(@RequestBody book: Book): Book = bookRepository.save(book)

    @GetMapping("/{id}")
    fun findById(@PathVariable id: Long): Book = bookRepository.findById(id).orElseThrow()

    @PutMapping("/{id}")
    fun update(@PathVariable id: Long, @RequestBody book: Book): Book {
        val existingBook = bookRepository.findById(id).orElseThrow()
        val updatedBook = existingBook.copy(
            title = book.title,
            author = book.author,
            year = book.year
        )
        return bookRepository.save(updatedBook)
    }

    @DeleteMapping("/{id}")
    fun deleteById(@PathVariable id: Long): ResponseEntity<Void> {
        bookRepository.deleteById(id)
        return ResponseEntity.noContent().build()
    }
}
```

6. Run the application and test the API using a tool like Postman.

