Here is an iterative function to calculate the Fibonacci sequence in Kotlin:

```
fun fib(n: Int): Int {
    val fibs = mutableListOf(0, 1)
    for (i in 2 until n + 1) {
        fibs.add(fibs[i - 1] + fibs[i - 2])
    }
    return fibs.last()
}
