from datetime import datetime, timedelta
from collections import defaultdict

class BotDetector:
    def __init__(self) -> None:
        self.users = defaultdict(list)
        self.window = timedelta(minutes=15)

    def receive_event(self, timestamp: datetime, user_id: str) -> None:
        self.users[user_id].append(timestamp)
        self.cleanup(timestamp)

    def cnt_bots(self) -> int:
        self.cleanup(datetime.now())
        return sum(len(events) > 1000 for events in self.users.values())

    def cleanup(self, timestamp: datetime) -> None:
        cutoff = timestamp - self.window
        for user_id, events in dict(self.users).items():
            while events and events[0] < cutoff:
                events.pop(0)
            if not events:
                del self.users[user_id]
