    BITMAPFILEHEADER bmfHdr;    
    BITMAPINFOHEADER bi;
    bi = bmi.bmiHeader;
    bi.biSizeImage = bi.biWidth * abs(bi.biHeight) * (bi.biBitCount >> 3); 
    bmfHdr.bfType = 0x4D42; // 0x42 0x4D  
    bmfHdr.bfSize = sizeof(BITMAPFILEHEADER) + bi.biSizeImage;
    bmfHdr.bfReserved1 = 0;    
    bmfHdr.bfReserved2 = 0;   
    bmfHdr.bfOffBits = sizeof(BITMAPFILEHEADER) + bi.biSize;

    FILE* f = fopen("output.bmp", "wb"); 
    fwrite(&bmfHdr, sizeof(bmfHdr), 1, f);
    fwrite(&bi, sizeof(bi), 1, f);    
    fwrite(bits, bi.biSizeImage, 1, f);
    fclose(f);   
}

