Binary search is a search algorithm that finds the position of a target value within a sorted array. It works on the principle of dividing the search interval in half repeatedly, until the target value is found or the search interval is empty.

The pseudocode for binary search is as follows:

```
function binarySearch(array, low, high, x) {
  if (high >= low) {
    // Find the middle point
    mid = (low + high) / 2;

    // If the element is at the middle itself
    if (array[mid] == x) {
      return mid;
    }

    // If element is smaller than mid, then it can only be present in
    // left subarray
    if (array[mid] > x) {
      return binarySearch(array, low, mid - 1, x);
    }

    // Else the element can only be present in right subarray
    return binarySearch(array, mid + 1, high, x);
  }

  // We reach here when element is not present in the array
  return -1;
}
```

Here, `array` is the input array, `low` is the index of the first element, `high` is the index of the last element, and `x` is the target value.

The algorithm starts by comparing `x` with the middle element of the array, i.e., `array[mid]`. If `x` is equal to `array[mid]`, then the algorithm returns `mid`. Otherwise, the algorithm recursively calls itself on the left or right subarray of the array, depending on whether `x` is less than or greater than `array[mid]`. The algorithm terminates when the search interval is empty or `x` is found.

Binary search is a very efficient algorithm with a time complexity of O(log n), where `n` is the number of elements in the array. This is because the algorithm eliminates half of the elements in the array at each step.

Binary search is a very commonly used algorithm in computer science. It is used in many different applications, such as searching for a file in a directory, finding a word in a text file, and finding a record in a database.

